description:
&quot;Nightshift&quot; is a nine-track album by The Commodores, released in 1985 on Motown Records. Nightshift won a Grammy (The Commodores only) but the rest of the songs stand for themselves as great work. A good, clean, old skool 80&amp;#039;s R&amp;B-Funk album.

It is here in both FLAC and HQ MP3, with a silly album cover.


TRACKS:
   1. &quot;Animal Instinct&quot;
   2. &quot;Nightshift&quot;
   3. &quot;I Keep Running&quot;
   4. &quot;Lay Back&quot;
   5. &quot;Slip of the Tongue&quot;
   6. &quot;Play This Record Twice&quot;
   7. &quot;Janet&quot;
   8. &quot;Woman in My Life&quot;
   9. &quot;Lighting Up The Night&quot;


Listen to it all and you&amp;#039;ll be surprised, but the title song, &quot;Nightshift&quot; is worth the download in itself.

Regards.
